<!DOCTYPE html>
<html>
    <head>
        <title>xDesign Laravel Boilerplate</title>

        <link href="//fonts.googleapis.com/css?family=Lato:100" rel="stylesheet">

        <style>
            html, body {
                height: 100%;
            }

            body {
                margin: 0;
                padding: 0;
                width: 100%;
                color: #B0BEC5;
                display: table;
                font-weight: 100;
                font-family: 'Lato', sans-serif;
                font-size: 28px;
            }

            .container {
                text-align: center;
                display: table-cell;
                vertical-align: middle;
            }
        </style>
    </head>
    <body>
        <div class="container">
            <div class="content">
                <img width="500" src="data:image/png;base64,">

                <p>Build something cool.</p>
            </div>
        </div>
    </body>
</html>